import Head from 'next/head'
import styles from '@/styles/Home.module.css'
import { P2PCash } from '../p2pcash'
import { useCallback, useState } from 'react'
import { Cluster, Peer } from 'p2p-cash'
import { DSProof, Script, Transaction } from 'bitcoin-minimal'
import Image from 'next/image'

export default function Home() {
  const [peer, setPeer] = useState<Peer>();
  const [cluster, setCluster] = useState<Cluster>();
  const [events, setEvents] = useState<string[]>([]);
  const [lookupHash, setLookupHash] = useState<string>("");
  const [response, setResponse] = useState<string[]>(["Request responses will be rendered here"]);
  const [signedTx, setSignedTx] = useState<string>("");
  const [showModal, setShowModal] = useState<boolean>(true);
  const connectCluster = useCallback(async () => {
    if (peer) {
      peer?.disconnect();
      setPeer(undefined);
    }
    if (cluster) {
      return;
    }

    const newCluster = P2PCash.getCluster();

    (async () => {
      newCluster.watchMempoolTransactionHashes((txId) => {
        setEvents(previous => [`${new Date().toLocaleTimeString()} txn ${txId.toString("hex")}`, ...previous]);
      });
      newCluster.watchNewBlocks((blockHash) => {
        setEvents(previous => [`${new Date().toLocaleTimeString()} blk ${blockHash.toString("hex")}`, ...previous]);
      });
      newCluster.watchDSProofIds((dspId) => {
        setEvents(previous => [`${new Date().toLocaleTimeString()} dsp ${dspId.toString("hex")}`, ...previous]);
      });
    })();
    setCluster(newCluster);
  }, [peer, cluster]);

  const connectPeer = useCallback(async () => {
    if (cluster) {
      cluster?.disconnect();
      setCluster(undefined);
    }
    if (peer) {
      return;
    }

    const newPeer = P2PCash.getPeer();
    (async () => {
      newPeer.watchMempoolTransactionHashes((txId) => {
        setEvents(previous => [`${new Date().toLocaleTimeString()} txn ${txId.toString("hex")}`, ...previous]);
      });
      newPeer.watchNewBlocks((blockHash) => {
        setEvents(previous => [`${new Date().toLocaleTimeString()} blk ${blockHash.toString("hex")}`, ...previous]);
      });
      newPeer.watchDSProofIds((dspId) => {
        setEvents(previous => [`${new Date().toLocaleTimeString()} dsp ${dspId.toString("hex")}`, ...previous]);
      });
    })();

    setPeer(newPeer);
  }, [peer, cluster]);

  const handleLookupHash = (event) => {
    setLookupHash(event.target.value);
  };
  const handleSignedTx = (event) => {
    setSignedTx(event.target.value);
  };

  const getTransaction = useCallback(async () => {
    const connection = peer ?? cluster;
    if (!connection) {
      return;
    }
    try {
      const transaction = await connection!.getTransaction(Buffer.from(lookupHash, "hex"));
      const result = [`Transaction ${lookupHash}`, "Inputs:"];
      for (const [index, input] of transaction.inputs.entries()) {
        const script = Script.fromBuffer(input.scriptBuffer);
        result.push(`   ${index}: from ${script.toCashAddress("mainnet") ?? "{not a P2PKH}"}`);
      }
      result.push("Outputs:");
      for (const output of transaction.outputs) {
        const script = Script.fromBuffer(output.scriptBuffer);
        result.push(`   ${output.vout}: ${output.satoshis} sats to ${script.toCashAddress() ?? "{not a P2PKH}"}`);
      }
      setResponse(result);
    } catch (e: any) {
      setResponse([e.message]);
    }
  }, [lookupHash, setResponse, peer, cluster]);

  const getBlock = useCallback(async () => {
    const connection = peer ?? cluster;
    if (!connection) {
      return;
    }
    try {
      const block = await connection!.getBlock(Buffer.from(lookupHash, "hex"));
      const result = [`Block #${block.getHeight()}`];
      result.push(`Size: ${block.size} bytes`);
      result.push(`Transactions: ${block.txCount}`);
      result.push(`Header:`);
      result.push(`   Version: ${block.header!.version.toString("hex")}`);
      result.push(`   Hash: ${block.header!.getHash().toString("hex")}`);
      result.push(`   PrevHash: ${block.header!.prevHash.toString("hex")}`);
      result.push(`   Merkle root: ${block.header!.merkleRoot.toString("hex")}`);
      result.push(`   Nonce: ${block.header!.nonce}`);
      result.push(`   Time: ${block.header!.time} - ${new Date(block.header!.time * 1000).toLocaleString()}`);

      setResponse(result);
    } catch (e: any) {
      setResponse([e.message]);
    }
  }, [lookupHash, setResponse, peer, cluster]);

  const getDSProof = useCallback(async () => {
    const connection = peer ?? cluster;
    if (!connection && lookupHash.length) {
      return;
    }
    try {
      const dsProof = lookupHash.length ? await connection!.getDSProof(Buffer.from(lookupHash, "hex")) :
        DSProof.fromBuffer(Buffer.from("", "hex"));

      const result = [`DSProof ${dsProof.getHash().toString("hex")}`];
      result.push(`Double-Spent UTXO: ${dsProof.prevTxId.toString("hex")}:${dsProof.prevOutIndex}`);
      result.push(`Spender 1:`);
      result.push(`   Tx Version: ${dsProof.spender1.txVersion}`);
      result.push(`   Sequence: ${dsProof.spender1.outSequence}`);
      result.push(`   Locktime: ${dsProof.spender1.lockTime}`);
      result.push(`   HashPrevOutputs: ${dsProof.spender1.hashPrevOutputs.toString("hex")}`);
      result.push(`   HashSequence: ${dsProof.spender1.hashSequence.toString("hex")}`);
      result.push(`   HashOutputs: ${dsProof.spender1.hashOutputs.toString("hex")}`);
      result.push(`   PushData count: ${dsProof.spender1.pushData.length}`);
      result.push(`   PushData chunks: ${dsProof.spender1.pushData.map(val => val.toString("hex")).join(" ")}`);

      result.push(`Spender 2:`);
      result.push(`   Tx Version: ${dsProof.spender2.txVersion}`);
      result.push(`   Sequence: ${dsProof.spender2.outSequence}`);
      result.push(`   Locktime: ${dsProof.spender2.lockTime}`);
      result.push(`   HashPrevOutputs: ${dsProof.spender2.hashPrevOutputs.toString("hex")}`);
      result.push(`   HashSequence: ${dsProof.spender2.hashSequence.toString("hex")}`);
      result.push(`   HashOutputs: ${dsProof.spender2.hashOutputs.toString("hex")}`);
      result.push(`   PushData count: ${dsProof.spender2.pushData.length}`);
      result.push(`   PushData chunks: ${dsProof.spender2.pushData.map(val => val.toString("hex")).join(" ")}`);

      setResponse(result);
    } catch (e: any) {
      setResponse([e.message]);
    }
  }, [lookupHash, setResponse, peer, cluster]);

  const getHeaders = useCallback(async () => {
    const connection = peer ?? cluster;
    if (!connection) {
      return;
    }
    try {
      const headers = await connection!.getHeaders({from: Buffer.from(lookupHash, "hex")});
      const result = [`Next 2000 block headers:`];
      setResponse([...result, ...headers.map(val => val.getHash().toString("hex"))]);
    } catch (e: any) {
      setResponse([e.message]);
    }
  }, [lookupHash, setResponse, peer, cluster]);

  const getMempool = useCallback(async () => {
    const connection = peer ?? cluster;
    if (!connection) {
      return;
    }
    try {
      setResponse(["Loading..."]);
      const mempools =  peer ? [await peer.getMempool()] : await cluster!.request(false, "getMempool");;
      const hashes = (mempools as Buffer[][]).flat(1).map(val => val.toString("hex")).filter((val, index, array) => array.indexOf(val) === index);
      setResponse(hashes);
    } catch (e: any) {
      setResponse([e.message]);
    }
  }, [setResponse, peer, cluster]);

  const broadcastTransaction = useCallback(async () => {
    const connection = peer ?? cluster;
    if (!connection || !signedTx.length) {
      return;
    }
    try {
      const txId = await connection.broadcastTransaction(Transaction.fromBuffer(Buffer.from(signedTx, "hex")));
      setLookupHash(txId.toString("hex"));
      getTransaction();
    } catch (e) {
      console.log(e);
    }
  }, [signedTx, peer, cluster, getTransaction]);

  return (
    <>
      <Head>
        <title>Create Next App</title>
        <meta name="description" content="Generated by create next app" />
        <meta name="viewport" content="width=device-width, initial-scale=1" />
        <link rel="icon" href="/favicon.ico" />
      </Head>
      <div className={`top-0 fixed flex items-center justify-center backdrop-blur z-10 w-full h-full p-5 lg:p-10 ${showModal ? "" : "hidden"}`} onClick={() => setShowModal(false)}>
        <div className="p-5 lg:p-10 w-full lg:w-[75%] h-full overflow-y-scroll lg:h-[75%] bg-slate-50 border-2 border-slate-300 border-solid rounded-3xl shadow-md  drop-shadow-3xl" onClick={() => {}}>
          <p className="text-sm lg:text-lg whitespace-pre-line">
{`P2P-CASH is a library which allows to communicate with Bitcoin full nodes such as BCHN.
While direct communication over TCP sockets is not available in the browsers, we make use of a lightweight WebSocket-to-TCP proxy[1].

The library features monitoring for new network events such as new mempool transactions, new blocks, new double spend proofs[2] and new peers joining the network.
On a lower level you can subscribe to and send any p2p messages defined in protocol[3]. On a higher level many convenient methods are exposed, such as broadcast already signed transactions, query for mempool contents, fetch most recent transactions, download block headers and entire blocks. Heck, you can even do the IBD (initial block download) and run a full node in your browser!

The idea of this library is to enable developers to create custom indexers and do sophisticated data analysis. Yeah, and without the need to host their own full node and download the entire blockchain first.

This is not a replacement for an ElectrumX server such as Fulcrum[4] but rather a complementary missing piece which adds more convenience and power to aid the developer as if they would work with a full node:
   * monitoring all new blocks, transactions and DSPs
   * monitoring specific address transactions
   * downloading blocks
   * getting mempool contents, etc.

You can choose to connect to a single trusted node or minimize the trust and connect to a cluster of several nodes. The cluster's confidence can be configured to be lower than 100% which increases the fault tolerance.

This project is a continuation and expansion of bsv-p2p[5], it adds support for cash addresses, p2sh addresses, cashtokens and cashtoken addresses, double spend proofs, convenience methods and cluster operation mode.
Idea of using a cluster is taken from great electrum-cash[6] project.
`}
          </p>
          <p className="mt-3">[1] <a className="text-sky-700" href="https://github.com/mainnet-pat/websockify-js">https://github.com/mainnet-pat/websockify-js</a></p>
          <p>[2] <a className="text-sky-700" href="https://flowee.org/docs/spec/network/messages/dsproof-beta/">https://flowee.org/docs/spec/network/messages/dsproof-beta/</a></p>
          <p>[3] <a className="text-sky-700" href="https://en.bitcoin.it/wiki/Protocol_documentation">https://en.bitcoin.it/wiki/Protocol_documentation</a></p>
          <p>[4] <a className="text-sky-700" href="https://electrum-cash-protocol.readthedocs.io/en/latest/protocol-methods.html">https://electrum-cash-protocol.readthedocs.io/en/latest/protocol-methods.html</a></p>
          <p>[5] <a className="text-sky-700" href="https://github.com/kevinejohn/bsv-p2p">https://github.com/kevinejohn/bsv-p2p</a></p>
          <p>[6] <a className="text-sky-700" href="https://gitlab.com/GeneralProtocols/electrum-cash/library">https://gitlab.com/GeneralProtocols/electrum-cash/library</a></p>
        </div>
      </div>
      <main className={styles.main + "mt-10 lg:mt-0 p-[1rem] lg:p-[4rem]"}>
        <h1 className="flex justify-center mb-3 text-xl font-bold underline decoration-dashed cursor-pointer" onClick={() => setShowModal(true)}>P2P-CASH DEMO</h1>

        <div className="flex justify-center gap-3 lg:gap-9 pl-0 lg:pl-4 mb-4">
          <button type="button" onClick={connectPeer} className="inline-block px-6 py-2.5 bg-gray-200 text-gray-700 font-medium text-xs leading-tight uppercase rounded shadow-md hover:bg-gray-300 hover:shadow-lg  active:bg-gray-400 active:shadow-lg transition duration-150 ease-in-out">Connect peer</button>
          <button type="button" onClick={connectCluster} className="inline-block px-6 py-2.5 bg-gray-200 text-gray-700 font-medium text-xs leading-tight uppercase rounded shadow-md hover:bg-gray-300 hover:shadow-lg  active:bg-gray-400 active:shadow-lg transition duration-150 ease-in-out">Connect cluster</button>
        </div>

        {peer && <div className="flex justify-center">
          <span>Connected to {`${peer.node}:${peer.port} via secure `} <a className="text-blue-900 underline decoration-dashed" href="https://github.com/mainnet-pat/websockify-js">websocket proxy</a> {` wss://${peer.wsProxyNode}. ${peer.peerVersion ? `Running ${peer.peerVersion?.userAgent}, protocol version: ${peer.peerVersion?.version}` : ""}`}</span>
        </div>}
        {cluster && (
          <div>
            <div className="flex justify-center">{`Required cluster confidence: ${cluster.clusterOptions.confidence} of ${Object.keys(cluster.clients).length}`}</div>
              <div className="flex overflow-y-scroll w-full">
                {Object.values(cluster!.clients).map(client => (<div key={client.connection.node}>
                  <span>Connected to {`${client.connection.node}:${client.connection.port} via secure `} <a className="text-blue-900 underline decoration-dashed" href="https://github.com/mainnet-pat/websockify-js">websocket proxy</a> {` wss://${client.connection.wsProxyNode}. ${client.connection.peerVersion ? `Running ${client.connection.peerVersion?.userAgent}, protocol version: ${client.connection.peerVersion?.version}` : ""}`}</span>
              </div>))}
            </div>
          </div>)}

        <div className="flex flex-wrap lg:flex-nowrap w-full">
          <div className="p-5 w-full">
            <p>New events</p>
            <div className="p-5 overflow-y-scroll border-black border-2 border-solid whitespace-pre-wrap h-[300px] font-mono text-sm">
              {events.map((row, index) =>
                (<p key={index}><span className={`font-normal ${row.includes("blk") && "bg-blue-100"} ${row.includes("dsp") && "bg-red-100"}`} key={row}>{row}</span></p>)
              )}
              <p>New transaction, <span className="bg-blue-100">block</span> and <span className="bg-red-100">double spend proof</span> hashes will appear here</p>
            </div>
          </div>
        </div>

        <hr className="border-gray-900" />

        <div className="flex flex-wrap lg:flex-nowrap w-full">
          <div className="p-5 w-full">
            <div className="flex flex-wrap lg:flex-nowrap gap-5 mb-3">
              <input value={lookupHash} onChange={handleLookupHash} placeholder="Hash" type="text" className="form-control block w-full px-3 py-1.5 text-base font-normal text-gray-700 bg-white bg-clip-padding border border-solid border-gray-300 rounded transition ease-in-out m-0 focus:text-gray-700 focus:bg-white focus:border-blue-600 focus:outline-none"/>
              <div className="relative">
                <span className="px-1 bg-yellow-100 rounded-xl absolute right-0 top-0 lg:right-[1px] lg:top-[1px] border-black border-solid border" title="Only a subset of transactions can be queried: those in mempool or recently relayed."><span className="hidden lg:block">&nbsp;?&nbsp;</span><span className="block lg:hidden">?</span></span>
                <button type="button" onClick={getTransaction} className="inline-block px-6 py-2.5 bg-gray-200 text-gray-700 font-medium text-xs leading-tight uppercase rounded shadow-md hover:bg-gray-300 hover:shadow-lg  active:bg-gray-400 active:shadow-lg transition duration-150 ease-in-out">Get Transaction</button>
              </div>
              <button type="button" onClick={getBlock} className="inline-block px-6 py-2.5 bg-gray-200 text-gray-700 font-medium text-xs leading-tight uppercase rounded shadow-md hover:bg-gray-300 hover:shadow-lg  active:bg-gray-400 active:shadow-lg transition duration-150 ease-in-out">Get Block</button>
              <div className="relative">
                <span className="px-1 bg-yellow-100 rounded-xl absolute right-0 top-0 lg:right-[1px] lg:top-[1px] border-black border-solid border" title="Leave hash input empty to decode a sample DSProof. DSProofs are short lived objects and will become unavailable after some time."><span className="hidden lg:block">&nbsp;?&nbsp;</span><span className="block lg:hidden">?</span></span>
                <button type="button" onClick={getDSProof} className="inline-block px-6 py-2.5 bg-gray-200 text-gray-700 font-medium text-xs leading-tight uppercase rounded shadow-md hover:bg-gray-300 hover:shadow-lg  active:bg-gray-400 active:shadow-lg transition duration-150 ease-in-out">Get DSProof</button>
              </div>
              <button type="button" onClick={getHeaders} className="inline-block px-6 py-2.5 bg-gray-200 text-gray-700 font-medium text-xs leading-tight uppercase rounded shadow-md hover:bg-gray-300 hover:shadow-lg  active:bg-gray-400 active:shadow-lg transition duration-150 ease-in-out">Get Headers</button>
              <div className="relative">
                <span className="px-1 bg-yellow-100 rounded-xl absolute right-0 top-0 lg:right-[1px] lg:top-[1px] border-black border-solid border" title="Querying mempool might break further DSProof lookups. See https://gitlab.com/bitcoin-cash-node/bitcoin-cash-node/-/issues/481"><span className="hidden lg:block">&nbsp;?&nbsp;</span><span className="block lg:hidden">?</span></span>
                <button type="button" onClick={getMempool} className="inline-block px-6 py-2.5 bg-gray-200 text-gray-700 font-medium text-xs leading-tight uppercase rounded shadow-md hover:bg-gray-300 hover:shadow-lg  active:bg-gray-400 active:shadow-lg transition duration-150 ease-in-out">Get Mempool</button>
              </div>
            </div>
            <div className="p-5 overflow-y-scroll border-black border-2 border-solid whitespace-pre-wrap h-[300px] font-mono text-sm">
              {response.map((row, index) =>
                (<p key={index}>{row}</p>)
              )}
            </div>
          </div>
        </div>

        <hr className="border-gray-900" />

        <div className="flex flex-wrap lg:flex-nowrap w-full">
          <div className="p-5 w-full">
            <div className="flex flex-wrap lg:flex-nowrap gap-5 mb-3">
              <input value={signedTx} onChange={handleSignedTx} placeholder="Signed raw transaction hex" type="text" className="form-control block w-full px-3 py-1.5 text-base font-normal text-gray-700 bg-white bg-clip-padding border border-solid border-gray-300 rounded transition ease-in-out m-0 focus:text-gray-700 focus:bg-white focus:border-blue-600 focus:outline-none"/>
              <button type="button" onClick={broadcastTransaction} className="inline-block px-6 py-2.5 bg-gray-200 text-gray-700 font-medium text-xs leading-tight uppercase rounded shadow-md hover:bg-gray-300 hover:shadow-lg  active:bg-gray-400 active:shadow-lg transition duration-150 ease-in-out">Broadcast transaction</button>
            </div>
          </div>
        </div>

        <div className="flex flex-col mt-5 items-center">
          <div className="text-lg ">Do you like P2P-CASH? Tips are welcome!</div>
          <div className="max-w-[200px]">
            <a href="bitcoincash:qqsxjha225lmnuedy6hzlgpwqn0fd77dfq73p60wwp?amount=0.1337">
              <Image
                src="data:image/svg+xml;base64,"
                title="bitcoincash:qqsxjha225lmnuedy6hzlgpwqn0fd77dfq73p60wwp"
                alt="bitcoincash:qqsxjha225lmnuedy6hzlgpwqn0fd77dfq73p60wwp"
              />
            </a>
          </div>
          <div>pat#111222; 🎀</div>
          <span className="flex flex-row"><span className="hidden lg:block">bitcoincash:</span>qqsxjha225lmnuedy6hzlgpwqn0fd77dfq73p60wwp</span>
        </div>
      </main>
    </>
  )
}
